import React, { Component } from "react";
class ClassDisplayText extends Component {
    render() {
        return (
            <div>
                <h2>Welcome to React!</h2>
                <p>This is a simple class component displaying static text.</p>
            </div>
        );
    }
}
export default ClassDisplayText;
